function App (){

    return (<div>

        <Header />

        {notes.map(note =>
        <Note 
        key ={notes[0].key}
        title={notes[0].title}
        content={notes[0].content}
        />)}
        <Footer />
        </div>)
}

//render all the notes in note.js separately as a note compomnent

export default App;
